using desafio_back.teste.xunit.Mocks.Factories;
using Microsoft.AspNetCore.Mvc.Testing;
using System.Text;
using System.Text.Json;

namespace desafio_back.tests.Apis;

public class DeliveryManApiTests : IClassFixture<WebApplicationFactory<Program>>
{
    private readonly HttpClient _client;

    public DeliveryManApiTests(WebApplicationFactory<Program> factory)
    {
        _client = factory.CreateClient();
    }

    [Fact]
    public async Task CreateDeliveryMan_ValidRequest_ReturnsCreated()
    {
        var requestBody = DeliveryManRequestFactory.CreateValid();

        var response = await _client.PostAsync("/entregadores", new StringContent(
            JsonSerializer.Serialize(requestBody), Encoding.UTF8, "application/json"));

        response.EnsureSuccessStatusCode();
        Assert.Equal(201, (int)response.StatusCode);
    }

    [Fact]
    public async Task CreateDeliveryMan_InvalidRequest_ReturnsBadRequest()
    {
        var requestBody = DeliveryManRequestFactory.CreateInvalid();

        var response = await _client.PostAsync("/entregadores", new StringContent(
            JsonSerializer.Serialize(requestBody), Encoding.UTF8, "application/json"));

        Assert.Equal(400, (int)response.StatusCode);
    }

    [Fact]
    public async Task SendDriverLicenseForDeliveryMan_ValidRequest_ReturnsCreated()
    {
        var requestBody = new
        {
            Imagem_cnh = ""
        };

        var response = await _client.PostAsync("/entregadores/primeiroEntregador/cnh", new StringContent(
            JsonSerializer.Serialize(requestBody), Encoding.UTF8, "application/json"));

        response.EnsureSuccessStatusCode(); // Verifica se o código de status é 2xx
        Assert.Equal(201, (int)response.StatusCode); // Verifica se o status code é Created (201)
    }

    [Fact]
    public async Task SendDriverLicenseForDeliveryMan_InvalidRequest_ReturnsBadRequest()
    {
        var requestBody = new
        {
            Imagem_cnh = "base64String"
        };

        var response = await _client.PostAsync("/entregadores/primeiroEntregador/cnh", new StringContent(
            JsonSerializer.Serialize(requestBody), Encoding.UTF8, "application/json"));

        Assert.Equal(400, (int)response.StatusCode); // Verifica se o status code é BadRequest (400)
    }
}
